import React from 'react'
import { MDBSelect } from "mdbreact";
export default function inputInfos() {
    const infos={
        options: [
          {
            text: "Option nr 1",
            value: "1"
          },
          {
            text: "Option nr 2",
            value: "2"
          },
          {
            checked: true,
            text: "Option nr 3",
            value: "3"
          },
          {
            text: "Option nr 4",
            value: "4"
          },
          {
            text: "Option nr 5",
            value: "5"
          }
        ]
      }

    return (
     
             <div>
        <MDBSelect
          search
          options={infos.options}
          selected="Choose your option"
          label="Example label"
        />
      </div>
    )
}
